create table person (
    id BIGSERIAL NOT NULL PRIMARY KEY,
	first_name VARCHAR(50) NOT NULL,
	last_name VARCHAR(50) NOT NULL,
	email VARCHAR(150),
	gender VARCHAR(7) NOT NULL,
	date_of_birth DATE NOT NULL,
	country_of_birth VARCHAR(50) NOT NULL
);


SELECT * FROM person
ORDER BY country_of_birth DESC;


SELECT * FROM person
ORDER BY id DESC;

SELECT * FROM person
ORDER BY date_of_birth;

SELECT DISTINCT country_of_birth FROM person;

SELECT * FROM person
WHERE gender = 'Female' AND
      (country_of_birth = 'Thailand' OR country_of_birth = 'Vietnam')

SELECT * FROM person
ORDER BY first_name DESC
LIMIT 11;

SELECT * FROM person
OFFSET 6 LIMIT 2;

SELECT * FROM person
OFFSET 5 FETCH FIRST 5 ROW ONLY;

SELECT * FROM person
WHERE country_of_birth IN ('China', 'Brazil')
AND gender = 'Female'
ORDER BY first_name DESC;

SELECT * FROM person
WHERE date_of_birth
BETWEEN DATE '2021-10-11' AND '2021-10-13'
ORDER BY date_of_birth DESC;

SELECT * FROM person
WHERE last_name LIKE '%ins';

SELECT * FROM person
WHERE last_name LIKE '___';

SELECT * FROM person
WHERE person.country_of_birth ILIKE 'z%';


SELECT DISTINCT country_of_birth from person;

SELECT country_of_birth from person
GROUP BY  country_of_birth;

SELECT country_of_birth, COUNT(*) from person
GROUP BY  country_of_birth
ORDER BY country_of_birth;
